import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 19.2-70 Reports to be filed by courts and Attorney General.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-70.md","filePath":"vacode/19.2-70.md"}'),o={name:"vacode/19.2-70.md"},n=a('<h1 id="§-19-2-70-reports-to-be-filed-by-courts-and-attorney-general" tabindex="-1">§ 19.2-70 Reports to be filed by courts and Attorney General. <a class="header-anchor" href="#§-19-2-70-reports-to-be-filed-by-courts-and-attorney-general" aria-label="Permalink to &quot;§ 19.2-70 Reports to be filed by courts and Attorney General.&quot;">​</a></h1><p>All courts of the Commonwealth and the Attorney General shall file all reports required by 18 U.S.C.A. § 2519. The Attorney General shall file a written report with the Clerks of the Senate and House of Delegates on or before December 31 of each year setting forth the number of applications made pursuant to this chapter, the number of interceptions authorized, the number of arrests resulting from each application, the number of convictions including a breakdown by offense, the cost of each application granted and the number of requests denied. Such information shall be made available by such Clerks to any member of the General Assembly upon request. However, notwithstanding the above requirements, no report shall be made concerning a granted application until after all inventories associated with such application are served pursuant to subdivision F 4 of § <a href="http://law.lis.virginia.gov/vacode/19.2-68/" target="_blank" rel="noreferrer">19.2-68</a>.</p><p>Code 1950, § 19.1-89.10; 1973, c. 442; 1975, c. 495; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0403" target="_blank" rel="noreferrer">403</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0414" target="_blank" rel="noreferrer">414</a>.</p>',3),i=[n];function s(l,c,d,h,f,p){return t(),r("div",null,i)}const _=e(o,[["render",s]]);export{b as __pageData,_ as default};
